import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faStar as solidStar } from '@fortawesome/free-solid-svg-icons';
import { faStar as regularStar } from '@fortawesome/free-regular-svg-icons';

const RatingStar = ({ rate }) => {
    const maxStars = 5;
    const filledStars = Math.floor(rate);
    const remainingStars = maxStars - filledStars;

    const filledStarIcons = Array.from({ length: filledStars }, (_, index) => (
        <FontAwesomeIcon key={index} icon={solidStar} className="text-yellow-500" />
    ));

    const emptyStarIcons = Array.from({ length: remainingStars }, (_, index) => (
        <FontAwesomeIcon key={index} icon={regularStar} className="text-gray-400" />
    ));

    return (
        <div className="flex items-center">
            {filledStarIcons}
            {emptyStarIcons}
        </div>
    );
};

export default RatingStar
